import React from 'react';
import { NavLink } from "react-router-dom";


const Menu = () => {

    return (
        <>
            <nav>
                <div style={{ margin: '10px' }}>
                    <NavLink to="/" style={({ isActive }) => ({
                        color: isActive ? 'greenyellow' : 'white'
                    })}>
                        Recettes
                    </NavLink>
                </div>
                <div style={{ margin: '10px' }}>
                    <NavLink to="/blog" style={({ isActive }) => ({
                        color: isActive ? 'greenyellow' : 'white'
                    })}>
                        Blog
                    </NavLink>
                </div>
            </nav >
        </>
    )

};

export default Menu;
